import logo from './logo.svg';
import './App.css';
import Header from './components/header/Header';

function App() {
  return (
    <div className="App">

      <HeaderBar>

      </HeaderBar>

    </div>

  );
}

function HeaderBar(props) {
  return (
    <nav className="headerbar">
      <ul className='headerbar-nav'> {props.children}</ul>
    </nav>
  )
}

function HeaderItem(props) {
  return (
    <li></li>
  )
}

export default App;
